import './App.css';
import logo from './trybe.png';
import Header from './Header';
import Content from './Content';
import Footer from './Footer';

function App() {
  return (
    <><><Header /><main className='main'><Content /></main><Footer /></><img src={logo}></img></>
  );
}

export default App;
